import styles from "./Search.module.css";
import rowStyles from "./SearchRow.module.css";

import React from "react";

const SearchRow = () => {
  return (
    <div className="row">
      <div className={rowStyles.rowItem}></div>
      <div className={rowStyles.rowItem}></div>
      <div className={rowStyles.rowItem}></div>
      <div className={rowStyles.rowItem}></div>
    </div>
  );
};
const Search = () => {
  return <div className={styles.container}>
    <SearchRow />
  </div>;
};

export default Search;
